import Input from "../Input/Input";

const Header = () => {
  return (
    <div className="header">
      <div className="header_item flex justify-between py-6">
        <div>
          <p>LOGO</p>
        </div>
        <div className="">
        <i class="fa fa-user-o fa-lg text-textColor" aria-hidden="true"></i>
            <Input type="email" placeholder="Email" 

            />

